import React, { Component } from "react";
import  CardNota  from "./CardNota";

class ListaNotas extends Component {
  render() {
    return (
      <>
        <ul>
          <li>
              <div>trabalho</div>
           <CardNota/>
          </li>
        </ul>
        <ul>
          <li>
          <CardNota/>
          </li>
        </ul>
        <ul>
          <li>
          <CardNota/>
          </li>
        </ul>
      </>
    );
  }
}

export default ListaNotas
